import { Card } from "../Card";
import "./style.css";

export const List = ({ listTransactions }) => {
  return (
    <main>
         <div>
      {listTransactions.map((item, index) => (
        <Card
          key={index}
          description={item.description}
          type={item.type}
          value={item.value}
        />
      ))}
    </div>
    </main>

  );
};
